import React, { Component } from "react";
class Counter extends Component {
  state = {
    count: 0,
  };
  render() {
    return (
      <div>
        <span>{this.format()}</span>
        <button className="">Increment</button>
      </div>
    );
  }
  format() {
    var { num } = this.state;
    // return num === 0 ? "zero" : num;
    return console.log(num);
  }
}

export default Counter;
